import React from "react";
import "./SideUser.css";

const SideUser = () => {
  return (
    <div className="side-user">
      <div className="user-bild"></div>
      <div className="user-info">
        <h1>Name here</h1>
        <h2>Position</h2>
      </div>
      <div></div>
      <footer>Profile</footer>
    </div>
  );
};

export default SideUser;
